            <div className='shop-page'>
            {collections.map(({ id, ...otherSectionProps}) => (
                    <CollectionPreview key={id} {...otherSectionProps}/>
                ))}
            </div>
        )

const mapStateToProps= createStructuredSelector(
    {
        collections: sele
    }
)
